const utama = ({quoteList}) =>{
    console.log(quoteList)
    return (
        <div className="justify-evenly flex-wrap  flex">
            {quoteList.map((quote) => (
                <div>
                    <p class="text-center mx-4 my-4 bg-white p-12 font-hammer text-base">{quote.isi}</p>
                </div>
            ))}
        </div>
    )
}

export default utama;
